import React, { useEffect, useState } from "react";
import { Container, Image, Row, Col } from "react-bootstrap";
import styles from "./styles.module.css";
import {
  IconLogos,
  IconMaps,
  IconImages1,
  IconImages2,
  IconImages3,
  IconsWa,
} from "../../assets";
import { SlideMenu } from "../../components/atoms";
import { useNavigate } from "react-router-dom";

const LoginPage = () => {
  const navigate = useNavigate();

  const choosePage2 = () => {
    navigate("/page2");
  };
  return (
    <div className={styles.pages}>
      {/* <Helmet title="Home" /> */}
      <Row className={styles.rowHeader}>
        <Col xs={2}>
          <Image src={IconLogos} className={styles.imgMenu} />
        </Col>
        <Col xs={8}>
          <p className={styles.textWallet}>Tablelink</p>
        </Col>
      </Row>
      <Container className={styles.containerHeader} onClick={choosePage2}>
        <Row style={{ marginTop: "36px" }}>
          <Col xs={9}>
            <div style={{ display: "block" }}>
              <p className={styles.textWallet2}>
                Choose Your{" "}
                <span>
                  <p className={styles.textWallet3}>Place</p>
                </span>
              </p>
            </div>
          </Col>
          <Col>
            <Image src={IconMaps} className={styles.imgMenu} />
          </Col>
        </Row>
        <div>
          <p className={styles.textWallet4}>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
            eiusmod tempor incididunt ut labore et dolore magna
          </p>
        </div>
        <Row className="my-2">
          <Image src={IconImages1} />
        </Row>
        <Row className="my-2">
          <Image src={IconImages2} />
        </Row>
        <Row className="my-2">
          <Image src={IconImages3} />
        </Row>
        <div>
          <p
            className={styles.textWallet4}
            style={{ textAlign: "center", marginTop: "20" }}
          >
            Read Our{" "}
            <span style={{ color: "#3267E3" }}>
              Terms & Condition, Privacy Policy
            </span>
          </p>
        </div>
        <div style={{ textAlign: "right", marginBottom: "24px" }}>
          <Image src={IconsWa} />
        </div>
      </Container>
    </div>
  );
};

export default LoginPage;
